import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Parse from 'parse'; // Parse ကို import လုပ်ဖို့မမေ့နဲ့ဦးနော်

const Home = () => {
  const navigate = useNavigate();
  const [courses, setCourses] = useState([
    /* ... အရင်က courses array အတိုင်းပဲ ... */
    { id: "linux", title: "Linux Admin", price: "55,000 MMK", duration: "2 Months", req: "Basic Computer", vidId: "yv_vPAtE_kQ", img: "https://images.unsplash.com/photo-1629654297299-c8506221ca97", detail: "Master Linux CLI, Server Management, and Security Auditing.", introDes: "Linux သည် server လောက၏ ဘုရင်ဖြစ်သည်။ Enterprise Server များ တည်ဆောက်ပုံကို လက်တွေ့သင်ကြားရမည်။" },
    { id: "cyber", title: "Cyber Security", price: "75,000 MMK", duration: "3 Months", req: "Network Basics", vidId: "Z3_6qJ0pGno", img: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b", detail: "Learn Threat Hunting, SOC Analysis, and Incident Response.", introDes: "Security Analyst တစ်ယောက်ဖြစ်ဖို့ လိုအပ်တဲ့ SOC Operations များကို Lab များဖြင့် လက်တွေ့လေ့ကျင့်ရမည်။" },
    // ... ကျန်တဲ့ဟာတွေလည်း အတူတူပဲ ...
  ]);

  const [selectedCourse, setSelectedCourse] = useState(null);
  const [showEnrollForm, setShowEnrollForm] = useState(false);
  const [formData, setFormData] = useState({ name: '', phone: '' });
  const [isSubmitting, setIsSubmitting] = useState(false);

  // Back4app ကို Enrollment ပို့မယ့် function
  const handleEnrollSubmit = async () => {
    if (!formData.name || !formData.phone) {
      alert("Please fill all fields, Agent!");
      return;
    }

    setIsSubmitting(true);
    try {
      const Enrollment = Parse.Object.extend("Enrollments");
      const enrollment = new Enrollment();

      await enrollment.save({
        studentName: formData.name,
        phoneNumber: formData.phone,
        courseTitle: selectedCourse.title,
        status: "pending"
      });

      alert("MISSION RECEIVED! We will contact you soon.");
      setShowEnrollForm(false);
      setFormData({ name: '', phone: '' });
    } catch (error) {
      console.error('Error while saving enrollment: ', error);
      alert("Uplink failed! Check your connection.");
    } finally {
      setIsSubmitting(false);
    }
  };

  /* ... handleNext, handlePrev logic များ ... */

  return (
    <div style={styles.pageWrapper}>
      {/* SECTION 1: SLIDER & SECTION 2: INTRO & FOOTER က အရင်အတူတူပဲမို့ မပြတော့ဘူးနော် */}

      {/* Modal Section (Back4app Logic ပါဝင်သော Form) */}
      {(selectedCourse || showEnrollForm) && (
        <div style={styles.modalOverlay} onClick={() => { if(!isSubmitting){ setSelectedCourse(null); setShowEnrollForm(false); } }}>
          <div style={styles.modalContent} onClick={e => e.stopPropagation()}>
            <div style={styles.modalHeader}>{showEnrollForm ? "Mission Registration" : "Mission Information"}</div>

            <div style={styles.modalMain}>
              {!showEnrollForm ? (
                // Course Briefing View
                <>
                  <h2 style={{ color: '#86efac', marginTop: 0 }}>[ MISSION: {selectedCourse.title} ]</h2>
                  {/* Video & Stats ... */}
                  <div style={{ display: 'flex', justifyContent: 'flex-end', gap: '10px', marginTop: '20px' }}>
                    <button style={styles.abortBtn} onClick={() => setSelectedCourse(null)}>CLOSE</button>
                    <button style={styles.enrollBtn} onClick={() => setShowEnrollForm(true)}>ENROLL NOW</button>
                  </div>
                </>
              ) : (
                // Enrollment Form View
                <div style={styles.formContainer}>
                   <h3 style={{ color: '#00ff41' }}>JOINING: {selectedCourse?.title}</h3>
                   <input 
                    style={styles.input} 
                    type="text" 
                    placeholder="STUDENT_NAME" 
                    value={formData.name}
                    onChange={(e) => setFormData({...formData, name: e.target.value})}
                   />
                   <input 
                    style={styles.input} 
                    type="text" 
                    placeholder="PHONE_NUMBER" 
                    value={formData.phone}
                    onChange={(e) => setFormData({...formData, phone: e.target.value})}
                   />

                   <div style={{ display: 'flex', gap: '10px', marginTop: '20px' }}>
                     <button 
                        style={styles.abortBtn} 
                        disabled={isSubmitting}
                        onClick={() => setShowEnrollForm(false)}
                     >
                        CANCEL
                     </button>
                     <button 
                        style={styles.enrollBtn} 
                        disabled={isSubmitting}
                        onClick={handleEnrollSubmit}
                     >
                        {isSubmitting ? "UPLOADING..." : "SUBMIT MISSION"}
                     </button>
                   </div>
                </div>
              )}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

// Styles က အရင်အတိုင်းပဲ...
const styles = { /* ... အရင်က styles တွေအတိုင်းပဲ ... */ };

export default Home;
